    /**
     * @return array|bool|float|int|string|\UnitEnum|null
     */
    public function getParameter(string $name)
    {
        if (isset($this->buildParameters[$name])) {
            return $this->buildParameters[$name];
        }

        if (!(isset($this->parameters[$name]) || isset($this->loadedDynamicParameters[$name]) || \array_key_exists($name, $this->parameters))) {
            throw new InvalidArgumentException(sprintf('The parameter "%s" must be defined.', $name));
        }
        if (isset($this->loadedDynamicParameters[$name])) {
            return $this->loadedDynamicParameters[$name] ? $this->dynamicParameters[$name] : $this->getDynamicParameter($name);
        }

        return $this->parameters[$name];
    }

    public function hasParameter(string $name): bool
    {
        if (isset($this->buildParameters[$name])) {
            return true;
        }

        return isset($this->parameters[$name]) || isset($this->loadedDynamicParameters[$name]) || \array_key_exists($name, $this->parameters);
    }

    public function setParameter(string $name, $value): void
    {
        throw new LogicException('Impossible to call set() on a frozen ParameterBag.');
    }

    public function getParameterBag(): ParameterBagInterface
    {
        if (null === $this->parameterBag) {
            $parameters = $this->parameters;
            foreach ($this->loadedDynamicParameters as $name => $loaded) {
                $parameters[$name] = $loaded ? $this->dynamicParameters[$name] : $this->getDynamicParameter($name);
            }
            foreach ($this->buildParameters as $name => $value) {
                $parameters[$name] = $value;
            }
            $this->parameterBag = new FrozenParameterBag($parameters);
        }

        return $this->parameterBag;
    }

    private $loadedDynamicParameters = [
        'kernel.runtime_environment' => false,
        'kernel.build_dir' => false,
        'kernel.cache_dir' => false,
        'sylius_messenger_transport_main_dsn' => false,
        'sylius_messenger_transport_main_failed_dsn' => false,
        'sylius_messenger_transport_catalog_promotion_removal_dsn' => false,
        'sylius_messenger_transport_catalog_promotion_removal_failed_dsn' => false,
        'sylius_admin.path_name' => false,
        'sylius.security.admin_regex' => false,
        'sylius.security.shop_regex' => false,
        'sylius.api.authorization_header' => false,
        'kernel.secret' => false,
        'debug.container.dump' => false,
        'serializer.mapping.cache.file' => false,
        'validator.mapping.cache.file' => false,
        'profiler.storage.dsn' => false,
        'doctrine.orm.proxy_dir' => false,
        'sylius.unsecured_urls' => false,
        'api_platform.swagger.api_keys' => false,
        'lexik_jwt_authentication.pass_phrase' => false,
    ];
    private $dynamicParameters = [];

    private function getDynamicParameter(string $name)
    {
        switch ($name) {
            case 'kernel.runtime_environment': $value = $this->getEnv('default:kernel.environment:APP_RUNTIME_ENV'); break;
            case 'kernel.build_dir': $value = $this->targetDir.''; break;
            case 'kernel.cache_dir': $value = $this->targetDir.''; break;
            case 'sylius_messenger_transport_main_dsn': $value = $this->getEnv('resolve:SYLIUS_MESSENGER_TRANSPORT_MAIN_DSN'); break;
            case 'sylius_messenger_transport_main_failed_dsn': $value = $this->getEnv('resolve:SYLIUS_MESSENGER_TRANSPORT_MAIN_FAILED_DSN'); break;
            case 'sylius_messenger_transport_catalog_promotion_removal_dsn': $value = $this->getEnv('resolve:SYLIUS_MESSENGER_TRANSPORT_CATALOG_PROMOTION_REMOVAL_DSN'); break;
            case 'sylius_messenger_transport_catalog_promotion_removal_failed_dsn': $value = $this->getEnv('resolve:SYLIUS_MESSENGER_TRANSPORT_CATALOG_PROMOTION_REMOVAL_FAILED_DSN'); break;
            case 'sylius_admin.path_name': $value = $this->getEnv('resolve:SYLIUS_ADMIN_ROUTING_PATH_NAME'); break;
            case 'sylius.security.admin_regex': $value = '^/'.$this->getEnv('string:resolve:SYLIUS_ADMIN_ROUTING_PATH_NAME'); break;
            case 'sylius.security.shop_regex': $value = '^/(?!'.$this->getEnv('string:resolve:SYLIUS_ADMIN_ROUTING_PATH_NAME').'|api/.*|api$|media/.*)[^/]++'; break;
            case 'sylius.api.authorization_header': $value = $this->getEnv('resolve:SYLIUS_API_AUTHORIZATION_HEADER'); break;
            case 'kernel.secret': $value = $this->getEnv('APP_SECRET'); break;
            case 'debug.container.dump': $value = ($this->targetDir.''.'/App_KernelDevDebugContainer.xml'); break;
            case 'serializer.mapping.cache.file': $value = ($this->targetDir.''.'/serialization.php'); break;
            case 'validator.mapping.cache.file': $value = ($this->targetDir.''.'/validation.php'); break;
            case 'profiler.storage.dsn': $value = ('file:'.$this->targetDir.''.'/profiler'); break;
            case 'doctrine.orm.proxy_dir': $value = ($this->targetDir.''.'/doctrine/orm/Proxies'); break;
            case 'sylius.unsecured_urls': $value = $this->getEnv('bool:SYLIUS_UNSECURED_URLS'); break;
            case 'api_platform.swagger.api_keys': $value = [
                'apiKey' => [
                    'name' => $this->getEnv('resolve:SYLIUS_API_AUTHORIZATION_HEADER'),
                    'type' => 'header',
                ],
            ]; break;
            case 'lexik_jwt_authentication.pass_phrase': $value = $this->getEnv('JWT_PASSPHRASE'); break;
            default: throw new InvalidArgumentException(sprintf('The dynamic parameter "%s" must be defined.', $name));
        }
        $this->loadedDynamicParameters[$name] = true;

        return $this->dynamicParameters[$name] = $value;
    }

